import { Link } from "react-router-dom";

function Navbar() {
    return (
        <nav>
            <nav className="nav">
                <img 
                    src="github-mark.png" 
                    className="nav-logo"
                    alt="GitHub Logo"
                />
                <Link to = {{ pathname: "https://github.com/Ankinen/ict-projects" }}
                        target="_blank">GitHub Repo</Link>
            </nav>
        </nav>
    )
};

export default Navbar
